import React from 'react';
import { useAuth } from '../../hooks/useAuth';

const LoginPage = () => {
    const { login } = useAuth();
    const [formData, setFormData] = React.useState({
        email: '',
        password: ''
    });
    const [loading, setLoading] = React.useState(false);
    const [error, setError] = React.useState('');

    const handleSubmit = async (e) => {
        e.preventDefault();
        setLoading(true);
        setError('');

        try {
            const result = await login(formData.email, formData.password);
            if (!result.success) {
                setError(result.error || 'Login failed');
            }
        } catch (err) {
            setError('Network error. Please try again.');
        } finally {
            setLoading(false);
        }
    };

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value
        });
    };

    return (
        <div className="min-vh-100 d-flex align-items-center" style={{ backgroundColor: 'var(--light-bg)' }}>
            <div className="container-custom">
                <div className="row justify-content-center">
                    <div className="col-md-6 col-lg-5">
                        <div className="bg-white rounded-3 shadow-sm p-5">
                            {/* Logo */}
                            <div className="text-center mb-5">
                                <div className="d-inline-flex align-items-center justify-content-center rounded-circle bg-light p-3 mb-3">
                                    <svg width="40" height="40" viewBox="0 0 30 32" fill="#FF385C">
                                        <path d="M29.24 22.68c-.16-.39-.31-.8-.31-1.24 0-1.36.92-2.45 2.45-2.45 1.38 0 2.5 1.12 2.5 2.5 0 .69-.28 1.32-.73 1.79-.18.2-.46.28-.73.28-1.11 0-.63-.39-1.17-.73-1.64-.73-.88 0-1.63-.29-2.42-.87-3.22-1.27-1.43-2.09-2.81-2.09-1.88 0-3.47.96-4.43 2.24-.96.96-2.02 1.49-2.02 1.01 0 1.93.41 2.89 1.23 2.89z"/>
                                    </svg>
                                </div>
                                <h2 className="fw-bold mb-2">Log in</h2>
                                <p className="text-muted">Welcome back to Airbnb Properties</p>
                            </div>

                            {/* Error Message */}
                            {error && (
                                <div className="alert alert-danger" role="alert">
                                    {error}
                                </div>
                            )}

                            {/* Login Form */}
                            <form onSubmit={handleSubmit}>
                                <div className="mb-4">
                                    <label htmlFor="email" className="form-label fw-semibold">
                                        Email address
                                    </label>
                                    <input
                                        type="email"
                                        className="form-control form-control-lg"
                                        id="email"
                                        name="email"
                                        value={formData.email}
                                        onChange={handleChange}
                                        placeholder="Enter your email"
                                        required
                                    />
                                </div>

                                <div className="mb-4">
                                    <label htmlFor="password" className="form-label fw-semibold">
                                        Password
                                    </label>
                                    <input
                                        type="password"
                                        className="form-control form-control-lg"
                                        id="password"
                                        name="password"
                                        value={formData.password}
                                        onChange={handleChange}
                                        placeholder="Enter your password"
                                        required
                                    />
                                </div>

                                <button
                                    type="submit"
                                    className="btn btn-danger btn-lg w-100 rounded-pill py-3"
                                    disabled={loading}
                                >
                                    {loading ? (
                                        <span className="spinner-border spinner-border-sm me-2" role="status"></span>
                                    ) : null}
                                    Continue
                                </button>
                            </form>

                            {/* Demo Credentials */}
                            <div className="text-center mt-4 pt-4 border-top">
                                <p className="text-muted small mb-2">
                                    Demo Agent Accounts:
                                </p>
                                <div className="small">
                                    <div><strong>Email:</strong> john@agent.com</div>
                                    <div><strong>Password:</strong> password123</div>
                                </div>
                                <div className="small mt-2">
                                    <div><strong>Email:</strong> sarah@agent.com</div>
                                    <div><strong>Password:</strong> password123</div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default LoginPage;
